package cn.cenjp.platform.bean;public class Role {    private String user_id;    private String role_name;    public Role() {    }    public Role(String user_id, String role_name) {        this.user_id = user_id;        this.role_name = role_name;    }    public String getUser_id() {        return user_id;    }    public void setUser_id(String user_id) {        this.user_id = user_id;    }    public String getRole_name() {        return role_name;    }    public void setRole_name(String role_name) {        this.role_name = role_name;    }    @Override    public String toString() {        return "Role{" +                "user_id='" + user_id + '\'' +                ", role_name='" + role_name + '\'' +                '}';    }}